const Grid = ({popMovies}) => {
  return (
 <div className='container row align-items-center'>
    {popMovies.map((movie)=>
     <div className="col-md-3">
      <Card movie={movie} key={movie.id}/>
      </div>
      )}
      </div>
  )
}

export default Grid
